static void initContention() {
  for(uint32 i=0;i<(kTLine*kLINES);i++)
  {
    contention[i]=0;

    if(i>=kFirst) {
      uint32 l=(i-kFirst) / kTLine;
      uint32 d=(i-kFirst) % kTLine;

      if(l<192 && d<128) {
        contention[i]=cPattern[d & 0x7];
      }
    }
  }
}

